import React from 'react';
import { connect } from 'react-redux';
import {
  IconSettings,
  PageHeader,
  Icon
} from '@salesforce/design-system-react';
import 'AccountActivity.css';

const mapStateToProps = (state) => {
  return {};
};

const mapDispatchToProps = (dispatch) => {
  return { dispatch };
};

class AccountActivity extends React.Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div>
        <IconSettings iconPage="/icons/">
          <PageHeader
            icon={<Icon category="standard" />}
            title="Account Activity"
            variant="object-home"
            className="AccountActivityHeader"
          />
        </IconSettings>
        <div className="slds-box slds-theme_default" id="formResult-body">
          <div className="slds-grid slds-gutter">
            <div className="slds-col">
              <div className="slds-box">
                <h1>Sends</h1>
              </div>
            </div>
            <div className="slds-col">
              <div className="slds-box"></div>
            </div>
            <div className="slds-col">
              <div className="slds-box"></div>
            </div>
            <div className="slds-col">
              <div className="slds-box"></div>
            </div>
            <div className="slds-col">
              <div className="slds-box"></div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(AccountActivity);
